import React from 'react';
import './Header.css';

function Header (){ 


    return (
        <>
      <div className="header">
        <div className="centered-div">
          <h1>Div 1</h1>
        </div>
        <div className="centered-div">
          <h1>Div 2</h1>
        </div>
        <div className="centered-div">
          <h1>Div 3</h1>
        </div>
      </div>
      <div className="left-div">
      <button  className="cart-button">Cart</button>
      </div>
      </>
    );
  } 


export default Header;
